import React from 'react';
import { AppBar, Toolbar, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    // AppBar is the main container that sticks to the top of the screen
    // position="sticky" ensures the navbar sticks while scrolling
    <AppBar position="sticky" sx={{ zIndex: 1100 }}>
      <Toolbar sx={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
        {/* Box is used to wrap buttons and ensure they are centered */}
        <Box sx={{
          display: 'flex',        // Flexbox to layout buttons in a row
          justifyContent: 'center', // Center the buttons horizontally
          width: '100%',           // Ensure Box takes full width
          gap: 2,                  // Space between the buttons
        }}>
          {/* Button links to various pages */}
          <Button color="inherit" component={Link} to="/" sx={{ textTransform: 'none' }}>
            Home
          </Button>
          <Button color="inherit" component={Link} to="/about" sx={{ textTransform: 'none' }}>
            About
          </Button>
          <Button color="inherit" component={Link} to="/projects" sx={{ textTransform: 'none' }}>
            Projects
          </Button>
          <Button color="inherit" component={Link} to="/contact" sx={{ textTransform: 'none' }}>
            Contact
          </Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
